<style>
  .panels{
		@apply
      block
      /* xl:min-h-[810px]  Not req */ 
    ; 
    width: 100vw;
    overflow: hidden;
    /* border: 2px solid blue; */
  }
  
  /* Panel 1 specific */
	.panel-1-outer-wrapper{
		@apply
      flex
			relative
			bg-stone-100
			overflow-hidden
      md:h-screen /* boiler plate */
      lg:h-screen
      xl:h-screen
      justify-center
		;
    /* Need virtual height adjs here. TODO. */
    min-height: 600px;
    height: 100vh;
    width: 100%;
    /* border: 2px solid red; */
	}	
	
  .panel-1-inner-wrapper{
    @apply
      xsm:pt-[110px]
      sm:pt-[110px]
      md:pt-[110px]
      xl:pt-[110px]

      lg:px-10
      md:px-8
      sm:px-4
      xsm:px-4
      flex
    ;
    min-height: 590px;
    /* max-height: 100%; redundant but testing TODO */ 
    max-width: 1200px; 
    background-image: url("https://dieupeut-bucket.us-east-1.linodeobjects.com/bw_full_collage_1.png");
    background-size: 45%;
    background-repeat: no-repeat;
    background-position-x: right;
    background-position-y: bottom;
    /* border: 4px solid green; */
    
  }

 .leading-title-statement-wrapper{
    @apply
      relative
      grow
      flex
      flex-col
      justify-between
    ;
    height: 40%;
    display: grid;
    grid-template-columns: repeat(20, [col] 5%);
    /* border: 2px solid blue;*/
 }
  
  .leading-title-statement{
    @apply
      text-[clamp(28px,8.5vw,74px)]
      /* xl:pr-96 */
    ;
    grid-column: col 1 / span 14;
    /* border: 2px solid red; */
  }

  .leading-title-welcome-svg-wrapper{
    @apply 
      flex
      mt-[auto]
      mb-[14%]
      justify-center 
    ;
    grid-column: col 15 / span 7;
    /* border: 2px green solid; */
  }

  #leading-title-welcome-svg{
    /* width: 26rem; TODO TEMP */
    height: auto;
    /* fill: rgb(67,56,202); */
    fill: rgb(45,10,171);
    
    stroke-dasharray: 1000;
    animation: dash 0.7s linear forwards;
  }

  #leading-title-welcome-svg-mobile{
    display: none;
    height: auto;
    fill: rgb(45,10,171);
    
    stroke-dasharray: 1000;
    animation: dash 0.7s linear forwards;
  }

  @keyframes dash{
    from{
      stoke-dashoffset: 1000;
    } to {
      stoke-dashoffset: 0;
    }
  }

  .leading-title-statement-description-main-text-wrapper{
    @apply
      xl:pr-10
      /* pb-7 */
    ;
    margin-right: 27rem;
    /* border: 2px solid orange; */
  }

  .leading-title-statement-description-main-text{
    @apply 
      md:pr-32
      lg:pr-32
      xl:pr-10
      text-2xl
      leading-[1.75]
      text-left
    ;
    /* border: 2px green solid; */
  }
 
  .leading-title-statement-lower-section{
    @apply
      flex
      flex-col
      justify-end
    ;
    padding-right: 40%;
    padding-top: 30px;
    min-height: 1.1rem;
     
    /* border: 2px cyan solid; */
  }

  .panel-1-buttons-wrapper{
    @apply
      flex
    ;
    /* border: 2px blue solid; */
  }

  .panel-1-buttons{
    @apply
      flex
      text-white
      font-bold
      text-lg
      py-1
      px-4
      mx-2
      rounded-full
    ;
    white-space: nowrap;
    text-decoration: none;
    will-change: transform;
    border: 1px black solid;  /* functional */
  }
  
  .panel-1-buttons:hover{
    transition-duration: 200ms;
    transform: scale(1.04);
    transition-timing-function: cubic-bezier(0.4, 0.2, 1);
  }

  #contact-button{
    @apply bg-indigo-700;
  }

  #learn-button{
    @apply bg-stone-600;
  }
  /* Rearrange main page button format. TODO */
  #donate-button{
    display: flex;
    justify-content: center;
    min-width: 90px;
    visibility: hidden;
    @apply bg-stone-600;
  }

  /* Moreinfo specific */
  #more-info-section{
    width: 100%;
    height: auto;
  }
  #learn-button-svg-mobile{
    display: none;
    width: 40px;
    height: 40px;
    /* border: 2px solid red; */
  }
  /* Panel-video specific */

	.panel-video-outer-wrapper{
		@apply
      flex
			relative
			/* bg-stone-100 */
      bg-black
			overflow-hidden
      justify-center
		;
    box-sizing: border-box;
    width: 100%;
    max-height: 230px;
    /* border: 2px solid blue; */
	}	
	
  .panel-video-inner-wrapper{
    @apply
      flex
    ;
    box-sizing: border-box;
    width:1600px; /* eh see ext eh*/
    width: full;
  }

  .panel-video-description-upper-wrapper{
    @apply
      flex
      justify-end
    ;
    top: 0px;
    /* width: 30%; */
    /* border: 3px solid green; */
  }

  .panel-video-description-inner-wrapper{
    @apply
      flex
      justify-end
    ;
    width: 1100px; 
    height: 100%;
    /* border: 2px solid red; */
  }

  .panel-video-text-wrapper{
    @apply
      flex
      flex-col
      justify-center
    ;
    text-align: center;
    font-size: 2rem;
    max-width: 400px;
    height: 97%;
    color: white;
    font-family: 'Permanent Marker', cursive;
    /* border: 3px solid green; */
  }
  
  .panel-video-text-sub{
    color: rgb(45,10,171); 
  }

  .panel-video-video-wrapper{
    @apply
      flex
      justify-around
      items-center
    ;
    min-width: 1600px;
    /* border: 2px solid purple; */
  }
  .panel-video-video{
    z-index: 5;
    display: block;
    overflow: hidden;
    width: 100%;
